import React from 'react'
import "./Posts.css"
import { PostsData } from '../../data/Posts'
import Post from '../Post/Post'

const Posts = () => {
    return (
        <div>
            {PostsData.map((post, index) => {
                return (
                    <Post />
                )
            })}
        </div>
    )
}

export default Posts
